import axios from 'axios'
import { URL } from '../constants/urls'

const getAll = async () => {
    const all = await axios.get(URL.WEATHERHISTORY)
    console.log('hey')
    console.log(all)
    return all
}

const create = (newObject: string) => {
    return axios.post(URL.WEATHERHISTORY, newObject)
}

const remove = () => {
    return axios.delete(URL.WEATHERHISTORY)
}

export default { getAll, create, remove }
